INSERT INTO table_static VALUES("26","","","","","ky-gui","","","&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;Nội dung ký gửi&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;Xin chân thành cám ơn quý khách hàng đã tin tưởng và ký gửi sản phẩm cho chúng tôi!&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;Bất động sản Phú Gia rất hân hạnh được hỗ trợ quý khách bán sản phẩm của mình.&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;Để chúng tôi có thể nhanh chóng bán được sản phẩm của quý khách trong thời gian ngắn nhất, giá cả cao nhất, xin quý khách vui lòng để lại những thông tin của lô đất như sau: &lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Diện tích : 5x20, 5x30, 10x30, 20x30,...(m2 )&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Hướng: đông, tây, nam , bắc,...&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Tên lô: Lô J1,J2....J56( hoặc L,K,i,H,G,F) ( tên lô đã có ghi trong sổ)&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Số thửa( hoặc ô) : có ghi trong sổ &lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;-Tờ bản đồ số: &lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Người đứng tên sổ: ÔNG(BÀ): NGUYỄN VĂN A, HỘ ÔNG(BÀ) NGUYỄN VĂN A, .....&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Giá bán mong muốn: &lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Số điện thoại liên hệ: 09xxxxxxxx&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;- Email, Zalo,viber,.....&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;* Lưu ý: nếu quý khách không có thời gian cung cấp những thông tin trên, vui lòng để lại số điện thoại và lời nhắn, chúng tôi sẽ chủ động liên lạc với quý khách trong thời gian nhanh nhất.&lt;/p&gt;\n\n&lt;p font-size:=&quot;&quot; helvetica=&quot;&quot; open=&quot;&quot;&gt;Xin cám ơn!&lt;/p&gt;\n","","","","Ký gửi","","kygui","1","1602127060","0");
